import React from 'react';
import { makeStyles } from '@material-ui/core/styles';
import Grid from '@material-ui/core/Grid';
import FormLabel from '@material-ui/core/FormLabel';
import FormControlLabel from '@material-ui/core/FormControlLabel';
import RadioGroup from '@material-ui/core/RadioGroup';
import Radio from '@material-ui/core/Radio';
import Paper from '@material-ui/core/Paper';
import TaskTypeCard from './taskTypeCard'

const useStyles = makeStyles((theme) => ({
    root: {
        flexGrow: 1,
    },
    paper: {
        height: 140,
        width: 100,
    },
    control: {
        padding: theme.spacing(2),
    },
}));

export default function TaskTypePicker() {
    const [spacing, setSpacing] = React.useState(2);
    const classes = useStyles();

    const handleChange = (event) => {
        setSpacing(Number(event.target.value));
    };

    return (
        <Grid container className={classes.root} spacing={2}>
            <Grid item xs={12}>
                <Grid container justify="center" spacing={spacing}>
                    <Grid key={value} item>
                        <TaskTypeCard 
                            image="src/assets/images/image_classification.png" 
                            title="Image Classification" 
                            text="Image classifiers are use to predict the object in an image. For instance, classifying whether an image contains a cat, or a dog" 
                            buttonText="Build an image classifier"
                        />
                    </Grid>
                    <Grid key={value} item>
                        <TaskTypeCard 
                            image="src/assets/images/predictor.png" 
                            title="Image Classification" 
                            text="Image classifiers are use to predict the object in an image. For instance, classifying whether an image contains a cat, or a dog" 
                            buttonText="Build an image classifier"
                        />
                    </Grid>
                    <Grid key={value} item>
                        <TaskTypeCard 
                            image="src/assets/images/structured.png" 
                            title="Image Classification" 
                            text="Image classifiers are use to predict the object in an image. For instance, classifying whether an image contains a cat, or a dog" 
                            buttonText="Build an image classifier"
                        />
                    </Grid>
                </Grid>
            </Grid>
        </Grid>
    );
}
